import axios from "axios"
import { storyEndPoint } from "./apiEndpoint"
import { tokenConfig } from "./authAPI"

export const getAllStories = (tokenConfig):Promise<any> => {
    return axios.get(storyEndPoint,tokenConfig)
}
export const createStory = (tokenConfig,userId):Promise<any> => {
    return axios.get(storyEndPoint,userId,tokenConfig)
}
